// JobsPage.jsx
import React, { useState } from 'react';
// Remove the CSS import since we'll use inline styles for this example

const JobsPage = () => {
  const [jobs, setJobs] = useState([
    {
      id: 1,
      ship: 'Unknown Ship',
      component: 'engine',
      type: 'inspection',
      priority: 'high',
      status: 'in progress',
      startDate: 'May 12, 2025 01:38',
      assignedTo: 'Unassigned'
    },
    {
      id: 2,
      ship: 'Ocean Queen',
      component: 'propeller',
      type: 'repair',
      priority: 'medium',
      status: 'pending',
      startDate: 'May 10, 2025 14:20',
      assignedTo: 'John Doe'
    }
  ]);

  const [filterShip, setFilterShip] = useState('All Ships');
  const [filterStatus, setFilterStatus] = useState('All Statuses');
  const [filterPriority, setFilterPriority] = useState('All Priorities');

  const updateJobStatus = (jobId, newStatus) => {
    setJobs(jobs.map(job => 
      job.id === jobId ? { ...job, status: newStatus } : job
    ));
  };

  const filteredJobs = jobs.filter(job => {
    return (
      (filterShip === 'All Ships' || job.ship === filterShip) &&
      (filterStatus === 'All Statuses' || job.status === filterStatus) &&
      (filterPriority === 'All Priorities' || job.priority === filterPriority)
    );
  });

  // Inline styles to replace the CSS file
  const styles = {
    page: {
      display: 'flex',
      minHeight: '100vh',
      fontFamily: 'Arial, sans-serif'
    },
    sidebar: {
      width: '250px',
      backgroundColor: '#2c3e50',
      color: 'white',
      padding: '20px'
    },
    // Add other styles as needed...
  };

  return (
    <div style={styles.page}>
      <div style={styles.sidebar}>
        <h2>Dashboard</h2>
        <ul>
          <li>Ship Management</li>
          <li className="active">Jobs</li>
          <li>Components</li>
          <li>Dark Mode</li>
          <li>Logout</li>
        </ul>
      </div>

      <div style={{ flex: 1, padding: '20px' }}>
        <h1>ShipMaster</h1>
        <div style={{ display: 'flex', gap: '20px', marginBottom: '20px' }}>
          <div style={{ display: 'flex', flexDirection: 'column', gap: '5px' }}>
            <label>Filter by Ship:</label>
            <select 
              value={filterShip} 
              onChange={(e) => setFilterShip(e.target.value)}
              style={{ padding: '5px', borderRadius: '4px', border: '1px solid #ddd' }}
            >
              <option value="All Ships">All Ships</option>
              <option value="Unknown Ship">Unknown Ship</option>
              <option value="Ocean Queen">Ocean Queen</option>
            </select>
          </div>

          {/* Add other filter groups similarly */}
        </div>

        <JobsTable jobs={filteredJobs} updateJobStatus={updateJobStatus} />
      </div>
    </div>
  );
};

const JobsTable = ({ jobs, updateJobStatus }) => {
  const handleComplete = (jobId) => {
    updateJobStatus(jobId, 'completed');
  };

  return (
    <table style={{ width: '100%', borderCollapse: 'collapse' }}>
      <thead>
        <tr>
          <th>Job ID</th>
          <th>Ship</th>
          <th>Component</th>
          <th>Type</th>
          <th>Priority</th>
          <th>Status</th>
          <th>Start Date</th>
          <th>Assigned To</th>
          <th>Actions</th>
        </tr>
      </thead>
      <tbody>
        {jobs.map(job => (
          <tr key={job.id}>
            <td>#{job.id}</td>
            <td>{job.ship}</td>
            <td>{job.component}</td>
            <td>{job.type}</td>
            <td style={{ 
              color: job.priority === 'high' ? '#e74c3c' : 
                    job.priority === 'medium' ? '#f39c12' : '#2ecc71',
              fontWeight: 'bold'
            }}>
              {job.priority}
            </td>
            <td>{job.status}</td>
            <td>{job.startDate}</td>
            <td>{job.assignedTo}</td>
            <td>
              <button 
                style={{ 
                  padding: '5px 10px',
                  marginRight: '5px',
                  border: 'none',
                  borderRadius: '4px',
                  cursor: 'pointer',
                  backgroundColor: '#2ecc71',
                  color: 'white'
                }}
                onClick={() => handleComplete(job.id)}
              >
                Complete
              </button>
            </td>
          </tr>
        ))}
      </tbody>
    </table>
  );
};

export default JobsPage;
